import React from "react";

export default function ObjectList({ title, children }) {

  const openAddObjectPage = (page)=>{
    console.log(page)
  }

  return (
    <div id="objectsList">
      <div className="titleStuff">
        <h3>{title}</h3>
        <button id="addButton" onClick={()=>{openAddObjectPage(title)}}>+</button>
      </div>

      {/* <input placeholder="search by name" /> */}
      <div id="actual-list">{children}</div>

    </div>
  );
}
